import React, { useState } from "react";
import "./Register.css";

const Register = () => {
  const [formChange, setFormChange] = useState({
    tempname: "",
    tempemail: "",
    tempnumber: "",
    tempfile: null,
  });

  const fname = formChange.tempname;
  const femail = formChange.tempemail;
  const fnumber = formChange.tempnumber;
  const ffile = formChange.tempfile;

  const [finalChange, setFinalChange] = useState({
    name: "",
    email: "",
    number: "",
    file: null,
  });

  const change = (event) => {
    event.preventDefault();
    const val = event.target.value;
    const nam = event.target.name;
    const fileName = event.target.files;

    if (nam == "Name") {
      setFormChange({
        ...formChange,
        tempname: val,
      });
    }

    if (nam == "email") {
      setFormChange({
        ...formChange,
        tempemail: val,
      });
    }

    if (nam == "number") {
      setFormChange({
        ...formChange,
        tempnumber: val,
      });
    }

    if (nam == "photo") {
      setFormChange({
        ...formChange,
        tempfile: fileName,
      });
    }
  };

  const formSubmit = (event) => {
    event.preventDefault();

    setFinalChange({
      name: fname,
      email: femail,
      number: fnumber,
      file: ffile,
    });

    console.log(finalChange);

    // console.log(formChange.fname);

    return (
      <>
        <div className="register-form">
          <form>
            <p className="form-heading">Register</p>

            <div className="txt-field">
              <input
                value={formChange.tempname}
                type="text"
                placeholder="Name"
                autoComplete="off"
                name="Name"
                onChange={change}
                // required
              />
            </div>

            <div className="txt-field">
              <input
                value={formChange.tempemail}
                type="email"
                placeholder="Email Address"
                autoComplete="off"
                name="email"
                onChange={change}
                // required
              />
            </div>

            <div className="txt-field">
              <input
                value={formChange.tempnumber}
                type="number"
                placeholder="Phone Number"
                autoComplete="off"
                name="number"
                onChange={change}
                // required
              />
            </div>

            <div className="photo-field">
              <p className="photo-title">Upload your Photo here</p>
              <input
                className="photo-input"
                type="file"
                accept="image/png, image/jpeg, image/jpg"
                // placeholder="Photo"
                autoComplete="off"
                name="photo"
                onChange={change}

                // required
              />
            </div>

            <button type="submit" onClick={formSubmit} className="btn">
              Submit
            </button>
          </form>
        </div>

        <h4>Your details are: </h4>

        <p>Name: {finalChange.name}</p>
        <p>Email: {finalChange.email}</p>
        <p>Number: {finalChange.number}</p>
        <img src={finalChange.file}></img>
        <p>{finalChange.file}</p>
      </>
    );
  };
};
export default Register;
